import React from "react";
import { StyleSheet, TouchableOpacity, Image } from "react-native";

import { LinearGradient } from "expo-linear-gradient";

function NavButton({ icon, onPress, position, sizeAndShape }) {
	return (
		<TouchableOpacity
			onPress={onPress}
			style={[styles.overContainer, position]}
		>
			<LinearGradient
				colors={["#F0FF49", "#FFF494"]}
				style={[styles.container, sizeAndShape]}
			>
				<Image source={icon} style={styles.icon} />
			</LinearGradient>
		</TouchableOpacity>
	);
}

const styles = StyleSheet.create({
	overContainer: {
		shadowColor: "#000",
		shadowOffset: {
			width: 2,
			height: 2,
		},
		shadowOpacity: 0.2,
		shadowRadius: 3,
		width: 69,
		height: 69,
		borderRadius: 35,
	},
	container: { borderRadius: 35 },
	icon: {
		width: "100%",
		height: "100%",
		alignItems: "center",
		justifyContent: "center",
		borderRadius: 100,
	},
});

export default NavButton;
